import React from 'react';
import DashboardService from '../services/DashboardService';
import { Link, Navigate, Route } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
import App from './App';

function Dashboard(){
const navigate = useNavigate();
class Dashboard extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      photos:[],
      username: '',
      photoName: ''
    }
    this.changephotonameHandler = this.changephotonameHandler.bind(this);


  }


  componentDidMount() {
    // console.log(this.props.route.params.username);
    DashboardService.getPhotos().then((Response) => {
      this.setState({photos: Response.data})
    });

  }


  getPhotos = (e) => {

    e.preventDefault();
    DashboardService.searchPhoto(this.state.photoName).then((Response) => {
      console.log("response: " + Response.data);
      if (Response.data !== '') {
        alert("no results");
      } else {

        navigate('searchResults', {
          photoName: this.state.photoName
        });
      }
    }).catch((error) => {
      console.log(error);
    });
  }

  changephotonameHandler= (event) => {
    this.setState({photoName: event.target.value});
}

  render () {
    return (
      <div>
        <h1 className="text-center">Photo List</h1>
        <input placeholder='Search' name="searchPhoto" className='form-control' value={this.state.photoName} onChange={this.changephotonameHandler}/>
        <button className='btn btn-success' onClick={this.getPhotos}>Search</button>
        <Link className='btn btn-primary' to="/">Logout</Link>
        <Link className='btn btn-primary' to="/addPhoto">Add Photo</Link>




        {/* <input type="file" name="file"></input> */}
        <table className='table table-striped'>
          <thead>
            <tr>
              <td>Photo ID</td>
              <td>Photo name</td>
              <td>User name</td>
            </tr>
          </thead>
          <tbody>
            {
              this.state.photos.map(
                photo =>
                <tr key = {photo.id}>
                    <td> {photo.id} </td>
                    <td> {photo.photoname} </td>
                    <td> {photo.username} </td>
                </tr>
              )
            }
          </tbody>
        </table>
      </div>
    )
  }
}
}
export default Dashboard;
